import React from 'react';


function SearchBar() {
    return (
        <div className="px-2 search-bar">
            <img className="d-inline-blcok mx-3 search-icon" src="data:image/svg+xml;utf8;base64," />
            <input className="search bg-0" type="text" placeholder="search" />
        </div>
    );
}

export default SearchBar;
